import React from 'react';

function Home() {
  return (
    <div className="home-content">
      <p>
        Hello, We are Pointer Customs, we specialize in carpentry, remodeling & home repair in
        South Central Wisconsin. Any home renovation project you can think of we can do! We are
        Licensed and insured supporting the Baraboo, Sauk City and Madison Area.{' '}
        <a href="tel:608-963-0803">Call for a quote today! (608) 963-0803</a>
      </p>
    </div>
  );
}

export default Home;
